import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return ( 
        <div>
            <div className="navbar">
        <div className="logo">Courses Webpage</div>
        <a href="/login" className="login-btn">Login</a>
      </div>
        </div>
     );
}
 
export default Navbar;
